export class RoomObjectSpriteData
{
    public objectId: number;
    public x: number;
    public y: number;
    public z: number;
    public name: string;
    public blendMode: string;
    public flipH: boolean;
    public skew: number;
    public frame: boolean;
    public color: string;
    public alpha: number;
    public width: number;
    public height: number;
    public type: string;
    public posture: string;
}
